var row=document.querySelector(".row")

var inName=document.getElementsByClassName("band-name")[0]
var inCountry=document.querySelector(".band-country");
var inImg=document.querySelector(".band-img");

var btn=document.querySelector(".band-btn")

// btn.onclick=function(){

// }

btn.addEventListener("click",function(e){
    e.preventDefault()

    var band={
        name:inName.value,
        country:inCountry.value,
        imgSrc:inImg.value 
    }

    row.innerHTML+=`
    <div class="card col-3" style="width: 18rem;">
        <img src="${band.imgSrc}"
            class="card-img-top" alt="${band.name}">
        <div class="card-body">
            <h5 class="card-title">Name: ${band.name}</h5>
            <h6>Country: ${band.country}</h6>

        </div>
    </div>

    `

})



const bands=[

    {
        name:"Nirvana",
        country:"America",
        imgSrc:"data:image/jpeg;base64,"
    },
    {
        name:"AC/DC",
        country:"Australia",
        imgSrc:"data:image/jpeg;base64,"
    },
    {
        name:"Rammstein",
        country:"Deutchland",
        imgSrc:"data:image/jpeg;base64,"
    },
    {
        name:"Metallica",
        country:"America",
        imgSrc:"data:image/jpeg;base64,"
    },
    {
        name:"Metallica",
        country:"America",
        imgSrc:"data:image/jpeg;base64,"
    }
    


]






for (let i = 0; i < bands.length; i++) {
    
    row.innerHTML+=`
    <div class="card col-3" style="width: 18rem;">
        <img src="${bands[i].imgSrc}"
            class="card-img-top" alt="${bands[i].name}">
        <div class="card-body">
            <h5 class="card-title">Name: ${bands[i].name}</h5>
            <h6>Country: ${bands[i].country}</h6>

        </div>
    </div>

    `
}
























